import React from "react";


const TableItem=(props)=>{
  console.log(props)
         return(
                  <>

      <tr>
        <td>{props.id}</td>
        <td>{props.title}</td>
        <td>{props.stack}</td>
        <td>
          <button className="btn btn-outline-danger">delete</button>
        </td>
      </tr>

                  </>
         )
}

export default TableItem;
